{
    "key":"data-clump-ArgoFigInk-ArgoFigSpline",
    "justification":"Both ArgoModeCreateFigInk and ArgoModeCreateFigSpline classes have three common fields _lastX, _lastY, _npoints that they use to store the coordinates and number of points for the figures they are creating (Ink and Spline respectively). These fields can be abstracted into a separate class or could be part of a base class that both ArgoModeCreateFigInk and ArgoModeCreateFigSpline inherit. Refactoring this clump would make the code easier to maintain and reduce the duplication of field definitions."
}
